import React, { useState } from 'react';

const ExaDeManagePage = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [tableData, setTableData] = useState([
    {
      Date: '2023-07-19',
      UserName: 'John Doe',
      Email: 'john.doe@example.com',
      Password: '********',
      Type: 'admin',
    },
    // Add more data entries as needed
  ]);

  const handleEdit = (index) => {
    // Logic to handle edit action goes here
    console.log('Edit:', index);
  };

  const handleDelete = (index) => {
    // Logic to handle delete action goes here
    console.log('Delete:', index);
  };

  const handleAdd = () => {
    // Logic to handle add action goes here
    console.log('Add new entry');
  };

  return (
    <div>

      <input
        type="text"
        placeholder="Search..."
        value={searchTerm}
        onChange={(e) => setSearchTerm(e.target.value)}
      />
      <div>
        <button onClick={handleAdd}>Add</button>
      </div>

      <table>
        <thead>
          <tr>
            <th>Date</th>
            <th>User Name</th>
            <th>Email</th>
            <th>Password</th>
            <th>Type</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {tableData.map((row, index) => (
            <tr key={index}>
              <td>{row.Date}</td>
              <td>{row.UserName}</td>
              <td>{row.Email}</td>
              <td>{row.Password}</td>
              <td>
                <select value={row.Type} onChange={(e) => console.log(e.target.value)}>
                  <option value="admin">admin</option>
                  <option value="super admin">super admin</option>
                </select>
              </td>
              <td>
                <select onChange={(e) => console.log(e.target.value)}>
                  <option value="">Select Action</option>
                  <option value="edit">Edit</option>
                  <option value="delete">Delete</option>
                </select>
              </td>
            </tr>
          ))}
        </tbody>
      </table>


    </div>
  );
};

export default ExaDeManagePage;
